  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Nine-pipe, Pablo,
  Pishkun, Willow Creek and Benton Lake National Wildlife Refuge outlines Refuge accomplishments
  from January through April of 1949.The report begins by summarizing the weather
  conditions, water conditions, and food and cover during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. Resource management is outlined;
  topics include grazing and fur harvesting. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, and
  violations. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
